import React from 'react';

import goodGreens from '../../images/good-greens-port.png';
import spooky from '../../images/mansion.png';
import password from '../../images/password_gen_plain.jpg';
import pwa from '../../images/sasha-profile.jpg';
import workDay from '../../images/sasha-profile.jpg';
import prework from '../../images/prework.jpg';

const styles = {
  contactStyle: {
    background: "#489D7C",
  }
}

export default function Portfolio() {
  return (
    <div>
      <h1>Portfolio Page</h1>

        <figure class="spotlight">
         
         <card>
          <h2 class="card-title-1">Good Greens</h2>
         <a href="https://shavanapuchta.github.io/good-greens-project-1/">
         <img src={goodGreens} alt="image of website for specialty restaurants"></img>
         </a>
         </card>
        </figure>

        {/* project 2 */}
        <figure class="card">
          <h2 class="card-title">A Night at the Manor</h2>
          <card>
          <a href="http://spooky-dudes.herokuapp.com/">
          <img src={spooky} alt="a cartoonish manor with a title that says A house with the comically bad yelp review"> </img>
          </a>
          </card>
        </figure>

        {/* project 3 */}
        <figure class="card">
          <h2 class="card-title">Project</h2>
          <card>
          <a href="./assets/images/building.jpeg">
          <img  src={password} alt="password generator"> </img>
          </a>
          </card>
        </figure>
        
        {/* project 4 */}
        <figure class="card">
          <h2 class="card-title">Project</h2>
          <card>
          <a href="./assets/images/horses.jpeg">
          <img src={pwa} alt="four horses grazing in a grass pasture with a tree"> </img>
          </a>
          </card>
        </figure>

        {/* project 5*/}
        <figure class="card">
          <h2 class="card-title">Project</h2>
          <card>
          <a href="./assets/images/hammock.jpeg">
          <img class="port-images"  src="./assets/images/hammock.jpeg" alt="woven hammock between two trees at sunset"> </img>
          </a>
          </card>
        </figure>
  
      
   </div>
  );
}
